#include <gtest/gtest.h>
#include "impl_strstr.cpp"

class ImplStrstrTest: public testing::Test{
    protected:
        Solution sol;
};
TEST_F(ImplStrstrTest, Small){
    EXPECT_EQ(1, sol.strStr("123", "23"));
    EXPECT_EQ(0, sol.strStr("123", "12"));
}
TEST_F(ImplStrstrTest, Missing){
    EXPECT_EQ(-1, sol.strStr("12", "123"));
    EXPECT_EQ(-1, sol.strStr("123", "456"));
}
TEST_F(ImplStrstrTest, Big){
    EXPECT_EQ(-1, sol.strStr("", ""));
}
